css:
:host,
atom-text-editor {
  background-color: #1d1f21;
  color: #f8f8f2;
}
:host .invisible-character,
atom-text-editor .invisible-character {
  color: #3d3d3d;
}
:host .indent-guide,
atom-text-editor .indent-guide {
  color: #3d3d3d;
}
:host .wrap-guide,
atom-text-editor .wrap-guide {
  background-color: #3d3d3d;
}
:host .gutter,
atom-text-editor .gutter {
  background-color: #242729;
}
:host .gutter .cursor-line,
atom-text-editor .gutter .cursor-line {
  background-color: #49483e;
}
:host .line-number.cursor-line-no-selection,
atom-text-editor .line-number.cursor-line-no-selection {
  background-color: #49483e;
}
:host .invisible,
atom-text-editor .invisible {
  color: #f8f8f2;
}
:host .cursor,
atom-text-editor .cursor {
  border-color: #f8f8f0;
}
:host .selection .region,
atom-text-editor .selection .region {
  background-color: #49483e;
}
:host .search-results .marker .region,
atom-text-editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888888;
}
:host .search-results .marker.current-result .region,
atom-text-editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
:host .comment,
atom-text-editor .comment {
  color: #75715E;
}
:host .string,
atom-text-editor .string {
  color: #E6DB74;
}
:host .constant.numeric,
atom-text-editor .constant.numeric {
  color: #AE81FF;
}
:host .constant.language,
atom-text-editor .constant.language {
  color: #AE81FF;
}
:host .constant.character,
atom-text-editor .constant.character,
:host .constant.other,
atom-text-editor .constant.other {
  color: #AE81FF;
}
:host .keyword,
atom-text-editor .keyword {
  color: #F92672;
}
:host .storage,
atom-text-editor .storage {
  color: #F92672;
}
:host .storage.type,
atom-text-editor .storage.type {
  font-style: italic;
  color: #66D9EF;
}
:host .entity.name.class,
atom-text-editor .entity.name.class {
  text-decoration: underline;
  color: #A6E22E;
}
:host .entity.other.inherited-class,
atom-text-editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #A6E22E;
}
:host .entity.name.function,
atom-text-editor .entity.name.function {
  color: #A6E22E;
}
:host .entity.name.instance,
atom-text-editor .entity.name.instance {
  color: #66D9EF;
}
:host .variable.parameter,
atom-text-editor .variable.parameter {
  font-style: italic;
  color: #FD971F;
}
:host .variable.language.js,
atom-text-editor .variable.language.js {
  color: #F92672;
}
:host .entity.name.tag,
atom-text-editor .entity.name.tag {
  color: #F92672;
}
:host .entity.other.attribute-name,
atom-text-editor .entity.other.attribute-name {
  color: #A6E22E;
}
:host .support.function,
atom-text-editor .support.function {
  color: #66D9EF;
}
:host .support.constant,
atom-text-editor .support.constant {
  color: #66D9EF;
}
:host .support.type,
atom-text-editor .support.type,
:host .support.class,
atom-text-editor .support.class {
  font-style: italic;
  color: #66D9EF;
}
:host .invalid,
atom-text-editor .invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
:host .invalid.deprecated,
atom-text-editor .invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
:host .class.jade,
atom-text-editor .class.jade {
  color: #AE81FF;
}
:host .gfm .markup.heading,
atom-text-editor .gfm .markup.heading {
  color: #A6E22E;
  font-weight: bold;
}
:host .gfm .markup.underline,
atom-text-editor .gfm .markup.underline {
  color: #E6DB74;
  text-decoration: underline;
}
:host .gfm .bold,
atom-text-editor .gfm .bold {
  font-weight: bold;
}
:host .gfm .italic,
atom-text-editor .gfm .italic {
  font-style: italic;
}
:host .gfm .raw,
atom-text-editor .gfm .raw {
  color: #66D9EF;
}
:host .gfm .variable.list,
atom-text-editor .gfm .variable.list {
  color: #F92672;
  font-weight: bold;
}
:host .gfm .link,
atom-text-editor .gfm .link {
  color: #CCC;
}
:host .gfm .link .entity,
atom-text-editor .gfm .link .entity {
  color: #AE81FF;
}
